import React from 'react';
import { View, StyleSheet } from 'react-native';

function Categories(props) {
    return (
        <View style={styles.categoryPlants}>

        </View>
    );
}

const styles = StyleSheet.create({

    categoryPlants: {
        height: '50%',
        width: '100%',
        backgroundColor: 'white',
    }

})

export default Categories;
